    "plt.grid()\n",
    "plt.show()\n",
    "\n",
    "# --- Cross-validation Accuracy ---\n",
    "cv_scores = cross_val_score(model3, X3, y3, cv=5, scoring='accuracy')\n",
    "print(\"Cross-validation Accuracy:\", np.mean(cv_scores))"
